function ListOfEntitiesPage(){
    return (
        <div className="col-lg-12 col-md-12 col-sm-12 col-xs-12">
            <ListOfEntities entity="franchise" />
        </div>
    );
}
export default withRouter (ListOfEntitiesPage);
